--
-- Triggers `class`
--
DELIMITER $$
CREATE TRIGGER `fill_attendance_percentage` BEFORE UPDATE ON `class` FOR EACH ROW INSERT into attendance_percentage (reg_no, class_id, percentage)
SELECT reg_no, class.class_id, (sum(no_of_hours)/number_of_classes)*100 from running_classes join class on running_classes.class_id = class.class_id where reg_no in (Select DISTINCT reg_no from running_classes) and entry = 'P' group by class.class_id, running_classes.reg_no
$$
DELIMITER ;

